import React, { useState } from 'react'

export const Form = () => {
  const [name,setName]= useState({
    fname:'',
    lname:''
  });
  const changeInput=(event)=>{
    console.log(event.target.value);
    console.log(event.target.name);
  };
  return (
    <div style={{textAlign:'center',background:'purple',height:'100vh',width:'100vw'}}>
      <form onSubmit={(e)=>{setName(name.fname); e.preventDefault()}} >
        <h1>Hello {name.fname}</h1><br />
        <input 
        onChange={changeInput}
        value={name.fname}
        name='fname'
         />
         <br />
          <input 
        onChange={changeInput}
        value={name.lname}
        name='lname'
         />
        <button type='submit'>Click me</button>
        </form>
    </div>
  )
}
